import React, { useEffect } from 'react'
import styles from './index.less'
import { useAppSelector } from '@/redux/storeIndex'
function index({ setAiEditorData }: any) {
    let MenuListData = [
        {
            icon: 'data:image/png;base64,',
            title:'Ai会话'
        },
        {
            icon: 'data:image/png;base64,',
            title: '全文生成'
        },
        {
            icon: 'data:image/png;base64,',
            title: '素材库'
        },
        {
            icon: 'data:image/png;base64,',
            title: '模板库'
        },
        {
            icon: 'data:image/png;base64,',
            title: '金句创作'
        },
        {

            icon: 'data:image/webp;base64,',
            title: 'Ai工具'
        },
        {
            icon: 'data:image/jpeg;base64,',
            title: 'Ai配图'
        },

    ]
  
    useEffect(() => {
      let open = localStorage.getItem('open')
        if (open) {
            setAiEditorData((prev: any) => ({
                ...prev,
                toolShow: true,
                toolCol: 6,
                timeCol:6,
                AiEditorCol: 16,
                currIndex: 2,
                BtnCol:6,
                currTitle:'全文生成'
            }))
        }
    }, [])
    let handleTab = (item: any, index: number) => {
        // console.log(item, index);
        setAiEditorData((prve: any) => ({
            ...prve,
            AiEditorCol: 16,
            toolCol: 6,
            toolShow: true,
            currIndex: index + 1,
            currTitle: item.title,
            outlineTop:'20%',
            timeCol:6,
            BtnCol:6
        }))
    }
    return (
        <div className={styles.menulist}>
            <div className={styles.menulist_content}>
                {
                    MenuListData&&MenuListData.map((item: any, index: number) => {
                        return (<div key={item.title} className={styles.menulist_item} onClick={() => {
                            handleTab(item, index)
                        }}>

                            <div><img src={item.icon} alt="" className={styles.menulist_icon} /></div>
                            <div className={styles.menulist_title}>{item.title}</div>
                        </div>)
                    })
                }
            </div>

        </div>
    )
}

export default index
